    return (
        <div className='contactInfo'>
            <h4>Email:<Link to='mailto:admin@mongobyte.com'> admin@mongobyte.com</Link></h4>
            <div className='streetAddress'><h4 className='address1'>Snail Mail: 1218 Bliss Dr</h4>
            <h4 className='address2'>St. Louis, MO 63137</h4></div>
        </div>
    );
};

export default contactInfo;
